import React from "react";
import PropTypes from "prop-types";
import {Router,Link } from "react-router-dom";
import styles from "./styles.module.scss";
import store, { history } from "../../redux/configureStore"
import logoimage from "../../images/logo.png"
const TopNav = (props, context) => (
  <div className={styles.TopNav}>
      <div className={styles.item}>
        <div className={styles.logobox}>
          
              <div className={styles.logo}>
                <Link to="/">
                  BIT DIARY
                </Link>
              </div>
           
        </div>
        <div className={styles.middlebox}>

        </div>
        <div className={styles.searchbox}>
          <input type="text" className={styles.search}  placeholder="소환사명을 입력해주세요" autocomplete="off"  onChange={props.onKeyPress} onKeyPress={props.onKeyPress}/>
          <button type="button"  className={styles.searchbutton} onClick={props.onClick}>
            <svg class="Icon-sc-1frisef-0 PlayerSearch__SearchIcon-vjyrzj-4 hbRehC cfvMRE" width="18" height="18" viewBox="0 0 20 20" fill="none" xmlns="http://www.w3.org/2000/svg">
              <path fill-rule="evenodd" clip-rule="evenodd" d="M16 8.56348C16 4.40356 12.625 1 8.5 1C4.375 1 0.999998 4.40356 0.999998 8.56348C0.999998 12.7234 4.375 16.127 8.5 16.127C10.3214 16.127 11.9822 15.4787 13.2947 14.3711L17.6341 18.7568C17.7949 18.9189 17.9822 19 18.1965 19C18.384 19 18.5982 18.9189 18.7589 18.7568C19.0804 18.4596 19.0804 17.9466 18.7589 17.6225L14.4195 13.2099C15.4106 11.9133 16 10.3193 16 8.56348ZM2.58049 8.59089C2.58049 5.32239 5.23228 2.64816 8.47335 2.64816C11.7144 2.64816 14.3662 5.32239 14.3662 8.59089C14.3662 11.8594 11.7144 14.5336 8.47335 14.5336C5.23228 14.5336 2.58049 11.8594 2.58049 8.59089Z" fill="currentColor">
              </path>
            </svg>
          </button>
        </div>

      </div>
  </div>
);

TopNav.propTypes = {
  onInputChange: PropTypes.func.isRequired,
  value: PropTypes.string.isRequired,
  onSubmit: PropTypes.func.isRequired,
  onKeyPress:PropTypes.func.isRequired,
  onClick:PropTypes.func.isRequired
};

TopNav.contextTypes = {
  t: PropTypes.func.isRequired
};

export default TopNav;
